import React from 'react';
import { Container} from 'react-bootstrap';

function Footer() {
    return (
        <footer className="footer mt-auto py-3">
            <Container>
                <span className="text-muted">Copyright&#169; 2021 KingFisher Kayaking</span>
            </Container>         
        </footer>
    )
}

export default Footer;
